const handler:URISchemeHandler<UUIDComponents, URIOptions, URNComponents> = {
	scheme : "urn:uuid",

	parse : function (urnComponents:URNComponents, options:URIOptions):UUIDComponents {
		const uuidComponents = urnComponents as UUIDComponents;
