    await fs.create(
      'hello_world.md',
      ['# Hello world', '', 'This is a simple markdown file'].join('\n')
    )

    const entry = new CollectionEntry({
      contentPath: join(fs.basePath, 'hello_world.md'),
      permalink: '/hello',
      title: 'Hello world',
    })

